import { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import jwt_decode from "jwt-decode";

import backDropVideo from "./components/video/backDropVideo.mp4";
import Home from "./components/Home";

function App() {
  return (
    <div>
      <Header />
      <div id="main-title">
        <h1>HEDGE*</h1>
      </div>
      <div id="sub-title">
        <p>
          *the art of investing with the intention of reducing the risk of
          adverse price movements.
        </p>

        <Router>
          <div className="App"></div>
        </Router>
        <Home />
        <video id="background" autoPlay loop muted>
          <source src={backDropVideo} type="video/mp4" />
        </video>
      </div>
    </div>
  );
}

export default App;
